import React from "react";
import { Redirect, Switch } from "react-router-dom";
import { AccountingYearPage } from "./accounting-year/AccountingYearPage"
import { ContentRoute } from "../../../_metronic/layout";

export default function MasterConfigure() {
  return (
    <Switch>
      <Redirect
        exact={true}
        from="/master-configure"
        to="/master-configure/accounting-year/list"
      />
      {/* Inputs */}
      <ContentRoute from="/master-configure/accounting-year" component={AccountingYearPage} />

    </Switch>
  );
}
